import React, { Component } from 'react';

class Contact extends Component {
    render() {
        return (
            <di style={{ backgroundColor: 'black', height: '100vh' }}>
                <div style={{width: '100%', backgroundColor: 'blue', height: '100%', marginTop: '0 !important', padding: '0 !important', position: 'relative', top: '0'}}> 
                    <h2>Contact Page</h2>
                </div>
                <div style={{ width: '100%', backgroundColor: 'red', height: '100%'}}> perros</div>
            </di>
        );
    }
};

export default Contact;
